     * @param Integer[] $nums
     * @return Integer
     */
    function majorityElement($nums) {
        $candidate = null;
        $count = 0;

        // Boyer-Moore Voting Algorithm
        foreach ($nums as $num) {
            if ($count == 0) {
                $candidate = $num;
            }

            if ($num == $candidate) {
                $count++;
            } else {
                $count--;
            }
        }

        return $candidate;
    }
