import java.util.HashSet;
import java.util.Set;

class Solution {
    public boolean containsDuplicate(int[] nums) {
        Set<Integer> seen = new HashSet<>();

        for (int num : nums) {
            // If we've seen this number before, it's a duplicate
            if (seen.contains(num)) {
                return true;
            }
            // Add the number to our set of seen numbers
            seen.add(num);
        }

        // No duplicates found
        return false;
    }
}

class Solution(object):
    def isAnagram(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: bool
        """
        # If lengths are different, they can't be anagrams
        if len(s) != len(t):
            return False

        # Count characters in both strings
        char_count = {}

        # Count characters in string s
        for char in s:
            char_count[char] = char_count.get(char, 0) + 1

        # Subtract characters from string t
        for char in t:
            if char not in char_count:
                return False
            char_count[char] -= 1
            if char_count[char] == 0:
                del char_count[char]

        # If all characters are matched, char_count should be empty
        return len(char_count) == 0

class Solution {

    /**
     * @param String $s
     * @param String $t
     * @return Boolean
     */
    function isAnagram($s, $t) {
        // If lengths are different, they can't be anagrams
        if (strlen($s) !== strlen($t)) {
            return false;
        }

        // Count character frequencies in both strings
        $charCount = [];

        // Count characters in string s
        for ($i = 0; $i < strlen($s); $i++) {
            $char = $s[$i];
            $charCount[$char] = ($charCount[$char] ?? 0) + 1;
        }

        // Subtract character counts from string t
        for ($i = 0; $i < strlen($t); $i++) {
            $char = $t[$i];
            if (!isset($charCount[$char]) || $charCount[$char] <= 0) {
                return false;
            }
            $charCount[$char]--;
        }

        // Check if all counts are zero
        foreach ($charCount as $count) {
            if ($count !== 0) {
                return false;
            }
        }

        return true;
    }
}

