var isAnagram = function(s, t) {
    if (s.length !== t.length) {        
        return false;
    }
    const charCount = new Map();
    for (let i = 0; i < s.length; i++) {
        charCount.set(s[i], (charCount.get(s[i]) || 0) + 1);
    }
    for (let i = 0; i < t.length; i++) {
        if (!charCount.has(t[i])) {
            return false;
        }
        charCount.set(t[i], (charCount.get(t[i]) || 0) - 1);
    }
    return Array.from(charCount.values()).every(count => count === 0);
};

class Solution {
    public boolean isAnagram(String s, String t) {
        // Different lengths cannot be anagrams
        if (s.length() != t.length()) {
            return false;
        }

        // Array to count frequency of each character (a-z)
        int[] charCount = new int[26];

        // Count characters in string s
        for (char c : s.toCharArray()) {
            charCount[c - 'a']++;
        }

        // Decrease count for characters in string t
        for (char c : t.toCharArray()) {
            charCount[c - 'a']--;
        }

        // Check if all character counts are zero
        for (int count : charCount) {
            if (count != 0) {
                return false;
            }
        }

        return true;
    }
}
